export default function Basket(props) {
    const { cart } = useSelector((state) => {
        return{
            products: state.product.products
        }
    })


    return (
        <aside>
            <h2>Cart Item</h2>
            <div>
                {cart.length === 0 && <div> Cart is Empty</div>}
            </div>
        </aside>
    )
}
